import React from "react";
import Svg, { Path, Defs, Pattern, Use, Image } from "react-native-svg";
const SvgLogoTexto = (props) => (
  <Svg
    width={1062}
    height={211}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    {...props}
  >
    <Path fill="url(#LogoTexto_svg__a)" d="M0 0h1062v211H0z" />
    <Defs>
      <Pattern
        id="LogoTexto_svg__a"
        patternContentUnits="objectBoundingBox"
        width={1}
        height={1}
      >
        <Use xlinkHref="#LogoTexto_svg__b" transform="scale(.00027 .00135)" />
      </Pattern>
      <Image
        id="LogoTexto_svg__b"
        width={500}
        height={100}
        xlinkHref="data:image/png;base64,"
      />
    </Defs>
  </Svg>
);
export default SvgLogoTexto;
